import PropTypes from 'prop-types';
function Book({book}){

    return(
        <table>
            <thead>
            <tr draggable="true">
                <td>{book.title}</td>
                <td>{book.author}</td>
                <td>{book.isbn}</td>
                <td>{book.year}</td>
            </tr>
            </thead>
        </table>
    )
}
Book.propTypes={
    title: PropTypes.string,
    author: PropTypes.string,
    isbn: PropTypes.number,
    year: PropTypes.string
}
export default Book;
